function App(props) {
  var isLoggedIn = false



  return (


   <div className="App">

  {!props.changeState ? (
      <div className="Login">







     <Form />
     </div>

     ) : ( 
        <div>
          <NavBar />
          <Main />

          </div>
    )}

    </div>




  );

  function mapStateToProps(state) {
    return {
      changeState: state.changeState
    };
  }


}




export default connect(mapStateToProps,null)(App)
